// frontend/src/pages/RunsPage.jsx
import React, { useEffect, useMemo, useRef, useState } from 'react';

const fmtDate = (iso) => (iso ? new Date(iso).toLocaleString() : '—');

const StatusPill = ({ status }) => {
  const map = {
    queued: { bg: '#e0e7ff', fg: '#1d4ed8', label: 'Na fila' },
    running: { bg: '#dcfce7', fg: '#166534', label: 'Rodando' },
    done: { bg: '#e2e8f0', fg: '#334155', label: 'Concluída' },
    stopped: { bg: '#fee2e2', fg: '#991b1b', label: 'Parada' },
    failed: { bg: '#fee2e2', fg: '#b91c1c', label: 'Falhou' },
  };
  const s = map[status] || { bg: '#f1f5f9', fg: '#334155', label: status || '—' };
  return (
    <span style={{ background: s.bg, color: s.fg, padding: '4px 8px', borderRadius: 999, fontSize: 12 }}>
      {s.label}
    </span>
  );
};

export default function RunsPage() {
  const [rows, setRows] = useState([]);
  const [loading, setLoading] = useState(false);
  const [auto, setAuto] = useState(true);
  const timer = useRef(null);

  const loadAll = async () => {
    try {
      setLoading(true);
      const r = await fetch('/api/runs');
      const data = await r.json();
      // normaliza campos (processed/total/progresso)
      const normalized = (data || []).map((it) => ({
        ...it,
        processed: it.processed ?? it.progress ?? 0,
        total: it.total ?? it.count ?? 0,
      }));
      setRows(normalized);
    } catch (e) {
      console.error('Falha ao carregar runs', e);
    } finally {
      setLoading(false);
    }
  };

  const refreshOne = async (id) => {
    try {
      const r = await fetch(`/api/runs/${id}`);
      if (!r.ok) throw new Error('not ok');
      const it = await r.json();
      setRows((prev) =>
        prev.map((row) =>
          row.id === id
            ? {
                ...row,
                ...it,
                processed: it.processed ?? it.progress ?? 0,
                total: it.total ?? it.count ?? 0,
              }
            : row
        )
      );
    } catch (e) {
      console.error('Falha ao atualizar run', e);
    }
  };

  const stopOne = async (id) => {
    if (!window.confirm('Tem certeza que deseja parar esta execução?')) return;
    try {
      const r = await fetch(`/api/runs/${id}/stop`, { method: 'POST' });
      if (!r.ok) throw new Error('not ok');
      await refreshOne(id);
      alert('Pedido de parada enviado.');
    } catch (e) {
      console.error('Falha ao parar run', e);
      alert('Não foi possível solicitar parada.');
    }
  };

  const exportOne = async (id) => {
    try {
      // Busca o detalhe e baixa como JSON
      const r = await fetch(`/api/runs/${id}`);
      if (!r.ok) throw new Error('not ok');
      const it = await r.json();
      const blob = new Blob([JSON.stringify(it, null, 2)], { type: 'application/json' });
      const a = document.createElement('a');
      a.href = URL.createObjectURL(blob);
      const name = (it.flowName || it.name || 'run') + '_' + id + '.json';
      a.download = name.replace(/\s+/g, '_');
      a.click();
      URL.revokeObjectURL(a.href);
    } catch (e) {
      console.error('Falha ao exportar', e);
      alert('Não foi possível exportar.');
    }
  };

  useEffect(() => {
    loadAll();
  }, []);

  useEffect(() => {
    if (auto) {
      timer.current = setInterval(loadAll, 4000);
    }
    return () => clearInterval(timer.current);
  }, [auto]);

  const runningCount = useMemo(
    () => rows.filter((r) => r.status === 'running' || r.status === 'queued').length,
    [rows]
  );

  return (
    <div style={{ padding: 16, maxWidth: 1100, margin: '0 auto' }}>
      <div style={{ display: 'flex', alignItems: 'center', gap: 12, marginBottom: 12 }}>
        <h2 style={{ margin: 0 }}>Execuções</h2>
        <span style={{ fontSize: 12, color: '#64748b' }}>
          {runningCount} em andamento
        </span>
        <div style={{ marginLeft: 'auto', display: 'flex', gap: 8 }}>
          <label style={{ display: 'flex', alignItems: 'center', gap: 6, fontSize: 13, color: '#475569' }}>
            <input
              type="checkbox"
              checked={auto}
              onChange={(e) => setAuto(e.target.checked)}
            />
            Auto-refresh
          </label>
          <button className="btn" onClick={loadAll} disabled={loading}>
            {loading ? 'Atualizando...' : 'Atualizar tudo'}
          </button>
        </div>
      </div>

      {(rows || []).length === 0 ? (
        <div
          style={{
            border: '1px dashed #cbd5e1',
            padding: 24,
            borderRadius: 12,
            color: '#64748b',
          }}
        >
          Nenhuma execução por aqui ainda.
        </div>
      ) : (
        <div style={{ display: 'grid', gap: 12 }}>
          {rows.map((row) => {
            const processed = Number(row.processed || 0);
            const total = Number(row.total || 0);
            const pct = total > 0 ? Math.round((processed / total) * 100) : 0;
            return (
              <div
                key={row.id}
                style={{
                  border: '1px solid #e5e7eb',
                  borderRadius: 12,
                  padding: 14,
                  background: '#fff',
                }}
              >
                <div style={{ display: 'flex', alignItems: 'center', gap: 10 }}>
                  <div style={{ fontSize: 13, color: '#64748b' }}>
                    <div>
                      <b>ID:</b> {row.id}
                    </div>
                    <div style={{ marginTop: 2 }}>
                      <b>Flow:</b> {row.flowName || '—'}
                    </div>
                  </div>

                  <div style={{ marginLeft: 16 }}>
                    <StatusPill status={row.status} />
                  </div>

                  <div style={{ marginLeft: 16, fontSize: 13, color: '#64748b' }}>
                    <b>Início:</b> {fmtDate(row.startedAt)}{' '}
                    <span style={{ marginLeft: 10 }}>
                      <b>Atualização:</b> {fmtDate(row.updatedAt)}
                    </span>
                  </div>

                  <div style={{ marginLeft: 'auto', display: 'flex', gap: 8 }}>
                    <button className="btn" onClick={() => exportOne(row.id)}>
                      Exportar
                    </button>
                    {(row.status === 'running' || row.status === 'queued') && (
                      <button className="btn danger" onClick={() => stopOne(row.id)}>
                        Parar
                      </button>
                    )}
                    <button className="btn" onClick={() => refreshOne(row.id)}>
                      Atualizar
                    </button>
                  </div>
                </div>

                <div style={{ marginTop: 12 }}>
                  <div
                    style={{
                      height: 8,
                      background: '#f1f5f9',
                      borderRadius: 999,
                      overflow: 'hidden',
                    }}
                    title={`${processed}/${total}`}
                  >
                    <div
                      style={{
                        width: `${pct}%`,
                        height: '100%',
                        background: '#2563eb',
                        transition: 'width .3s ease',
                      }}
                    />
                  </div>
                  <div style={{ marginTop: 6, fontSize: 12, color: '#64748b' }}>
                    Progresso: <b>{processed}</b> de <b>{total}</b> ({pct}%)
                  </div>
                </div>
              </div>
            );
          })}
        </div>
      )}
    </div>
  );
}
